(5, 1, 'DISTRIBUTION OF RELIEF GOODS', 'Barangay Fort Bonifacio (BFB) is considered a newly created barangay of the City of Taguig by virtue of the Sangguniang Panlungsod Ordinance No. 68 Series of 2008. Along with Barangay Pinagsama, BFB was once part of Barangay Western Bicutan (which was retained as the mother barangay). It started to function on April 04, 2009 under the following first appointed barangay officials: Armando S. Lopez as Barangay Chairman, with Nicasio T. Asyao, Henry S. Estribello, Benigno Z. Marasigan, Wilfredo S. Sayson Christian L. Tinga, and Lysandre T. Vertulfo as Barangay', '2022-10-01', '2022-10-01', '2022-09-03 21:37:02', '2022-11-13 07:47:00', 0, 1, 1),
(6, 3, 'Christmas Give away', 'Go to barangay', '2022-10-16', '2022-10-16', '2022-10-01 07:55:06', '2022-10-16 19:06:43', 0, 1, 1),
