(15, 2, 'Christmas Giveaway ', 'Go to the barangay hall and present your id to claim your free Christmas giveaway \r\n\r\nDate: December 23, 2022 ', '2022-12-23', '2022-12-23', '2022-11-06 08:00:32', '2022-11-06 08:00:32', 0, 1, NULL),
(16, 2, 'Barangay Wawa Christmas Bazaar', 'Magandang Araw po Barangay Wawa,Isa pong panawagan para sa lahat po ng mga nagnanais lumahok o sumali sa gagawin Barangay Wawa Christmas Bazaar. Ang Christmas Bazaar na ito ay sa kabutihang Loob ng ating Kapitan Phillip Buenaflor. Maraming salamat po.', '2022-12-18', '2022-12-20', '2022-11-06 08:05:02', '2022-11-06 08:05:02', 0, 1, NULL),
(17, 2, 'Halloween Make Up Competition', 'Magandang Araw, Barangay Wawa!\r\n\r\nGood news! Dahil by popular demand, magkakaroon ng karagdagang 50 slots para sa mga kabataang edad 15 years old pababa na nais pang lumahok sa darating na Youth Halloween/Costume Contest/ Parade CUTE CATEGORY.\r\n\r\nSang KataCute na Saya at Ligaya Parade Year 2\r\nHalloween is just around the corner! Dress yourself and make the spookiest costume - BE CREATIVE!\r\n.This will be held on Oct 31, 2022 MONDAY', '2022-10-31', '2022-10-31', '2022-11-06 08:07:26', '2022-11-06 08:07:26', 0, 1, NULL),
(18, 2, 'Libreng Tuli', 'Magandang Araw!\r\nLibreng Tuli Para sa mga bata\r\n\r\nInaanyayaan namen kayo na pumunta sa court para sa libreng tuli.\r\nWhen: March 15, 2022\r\n*Who: Child\r\nWhere: Barangay court\r\n*Time: 7:00am to 3:00pm\r\n \r\nMaraming salamat po!\r\nFrom: Kap. Phillip Buenaflor\r\nBARANGAY WAWA â€“ TAGUIG CITY\r\n', '2022-11-20', '2022-11-20', '2022-11-11 10:59:37', '2022-11-13 04:50:36', 0, 1, 1),
(19, 1, 'BAKUNA PARA SA ASO', 'BAKUNA', '2022-11-14', '2022-11-14', '2022-11-12 23:07:12', '2022-11-13 07:48:05', 0, 1, 1),
(20, 3, 'Barangay giveaway', 'aowndakjnwdkajnwdkjanwdjkanwdkjanwdjkanwdkjanwdawd', '2022-11-13', '2022-11-14', '2022-11-13 01:07:16', '2022-11-13 01:08:07', 0, 1, 1),
(21, 2, 'HEALTH EQUIPMENT', 'Magandang araw Barangay Wawa!\r\nAng Sangguniang Kabataan ng Barangay Wawa ay maglulungsad ng proyektong pangkalusugan. Kung saan pwedeng humiram ng ibaâ€™t ibang uri ng HEALTH EQUIPMENT kagaya ng mga sumusunod:\r\nOXYGEN TANK\r\nNEBULIZER\r\nBLOOD PRESSURE MONITOR\r\nBLOOD SUGAR TEST KIT\r\nPULSE OXYMETER\r\nFIRST AID KIT\r\nCANE\r\nPara sa lahat ng mga nais humiram mag message lang po dito sa sa Facebook page ng SK BRGY WAWA o di kaya naman kay Sk Kagawad Celine Silvestre.\r\nAng proyektong ito ay sa pangunguna ni SK Chairman Julian Erico CartaÃ±o at mga kagawad. Sa pakikipag tulungan sa pamahalaan lungsod ng Taguig sa pamumuno ni Mayor Lani Cayetano, sa tulong at gabay ng ating Kapitan. Brgy Capt. Phillip Buenaflor at mga kagawad. ', '2022-11-13', '2022-11-13', '2022-11-13 04:45:29', '2022-11-13 04:45:29', 0, 1, NULL),
(22, 1, 'RAFFLE FOR GROCERIES', '123', '2022-11-13', '2022-11-13', '2022-11-13 10:16:23', '2022-11-15 21:18:17', 0, 1, 1),
(23, 3, 'Barangay Giveaway', 'Go to barangay', '2022-11-15', '2022-11-15', '2022-11-15 22:44:45', '2022-11-15 23:02:49', 0, 1, 1);
