INSERT INTO `tbl_settings` (`id`, `about`, `mission`, `vision`, `created_date`, `updated_date`, `deleted_flag`, `home_title`, `home_description`) VALUES
(1, 'Barangay Wawa is a thriving neighborhood in Taguig. Laguna de Bay is to the east, Hagonoy is to the south, Bambang is to the west, and the Taguig River is to the north. Due to its farming, Barangay Wawa is about 140 hectares in size. There are several wards in Barangay Wawa, including Purok 1 - Quezon St., which extends to the middle of the street and leads to Tambak; Ward 2 - Piles; Ward 3 - Horse Shoe or Guerrero St., which leads to Jones St.; and Ward 4 - Puwang (farms). Historically, the village was also known by the name Wawa. The meeting location for fish dealers and fishermen is here. Other elders claim that the word \"Wawa\" derives from the baby\'s \"ua-ua\" cry because this village was thought to have been impoverished in the past. As a result, the name of the village was derived from this cry, which eventually became Wawa. The population was 14,350 according to the 2020 Census. This accounted for 1.62% of Taguig\'s total population. The current appointed officials were led by Barangay Chairman Phillip E. Buenaflor and the Barangay Councilors Jenson R. Garcia, Gregorio A. Valenzuela Jr, Manuel D. Liwanag, Cyndie C. Bonifacio, Joey C. Dionisio, Virgilio S. Dionisio, Rizalito SP. sta. Barbara, Julian Erico S. Cartano, Dennis D. Catama, Sally M. Dionisio, Arcangel C. Silvestre', 'Barangay Wawa aims to eradicate poverty and catastrophe effect avoidance utilizing disaster-resilient, climate-change competent, and financially viable improvement initiatives, endeavors, and services that are completely in line with the development and preservation of human culture and ecosystem.', 'A truly sustainable, financially advanced, disaster-resilient, climate-change competent, and self-subsistent society with priviledged citizens living in quite well-organized and clean atmosphere administered by vigorous, innovative, knowledgeable, and God-fearing government officials.', '2022-11-14 19:04:32', '2022-11-14 19:04:32', 0, 'Welcome to Barangay Wawa', 'Barangay Wawa is a barangay located in the city of Taguig. Its population as determined by the 2020 Census was 14,350. This represented 1.62% of the total population of Taguig. with the current appointed barangay officials Philip E. Buenaflor as Barangay Chairman with Joey Dionisio, Bogie Garcia, Manuel Liwanag, Virgilio Dionisio, Cyndie Bonifacio, Gregorio Valenzuela Jr, Jenson Garcia as Barangay Kagawads.');
